graphviz:
digraph {
  // Graph attributes
  label=<<table border="0" cellborder="0" cellspacing="0" cellpadding="4"></table>>;
  labelloc="t";
  fontsize=10;
  fontname="Arial";
  compound=true;
  rankdir=TB;
  pad=0.25;
  node [fontname="Arial", fontsize=10];
  edge [fontname="Arial", fontsize=9];

  // Node definitions with nested namespaces
  "config" [label=<<table border="0" cellborder="0" cellspacing="0" cellpadding="4"><tr><td align="left"><b>config</b> <i>&lt;context&gt;</i></td></tr><tr><td><table border="0" cellborder="1" cellspacing="0" cellpadding="2" align="left"><tr><td port="database__key" align="left" balign="left">database</td><td port="database__value" align="left" balign="left">#dbConnection</td></tr><tr><td port="cache__key" align="left" balign="left">cache</td><td port="cache__value" align="left" balign="left">#redisClient</td></tr><tr><td port="logger__key" align="left" balign="left">logger</td><td port="logger__value" align="left" balign="left">#appLogger</td></tr></table></td></tr></table>>, shape=folder, fillcolor="#E8F5E9", style=filled, color="#388E3C"];

}
